import React, { useState, useEffect } from 'react';
import axios from 'axios';

export default function TeacherRegister() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [message, setMessage] = useState('');
  const [isError, setIsError] = useState(false);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    if (message) {
      const timer = setTimeout(() => setMessage(''), 4000); // 4 saniye sonra mesajı temizle
      return () => clearTimeout(timer);
    }
  }, [message]);

  const handleRegister = async (e) => {
    e.preventDefault();

    if (username.trim().length < 3) {
      setMessage('Kullanıcı adı en az 3 karakter olmalı.');
      setIsError(true);
      return;
    }
    if (password.trim().length < 6) {
      setMessage('Şifre en az 6 karakter olmalı.');
      setIsError(true);
      return;
    }

    setLoading(true);
    setMessage('');
    setIsError(false);

    try {
      const res = await axios.post('http://localhost:8080/api/auth/teacher/register', {
        username: username.trim(),
        password: password.trim(),
      });
      setMessage(res.data || 'Kayıt başarılı! Giriş yapabilirsiniz.');
      setIsError(false);
      setUsername('');
      setPassword('');
    } catch (err) {
      setMessage(err.response?.data?.message || 'Bir hata oluştu. Tekrar deneyin.');
      setIsError(true);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>Öğretmen Kayıt</h2>
      <form onSubmit={handleRegister} style={styles.form} noValidate>
        <div style={styles.inputGroup}>
          <label htmlFor="username" style={styles.label}>Kullanıcı Adı:</label>
          <input
            id="username"
            type="text"
            value={username}
            onChange={e => setUsername(e.target.value)}
            style={styles.input}
            placeholder="Kullanıcı adınızı girin"
            disabled={loading}
            required
            minLength={3}
          />
        </div>
        <div style={styles.inputGroup}>
          <label htmlFor="password" style={styles.label}>Şifre:</label>
          <input
            id="password"
            type="password"
            value={password}
            onChange={e => setPassword(e.target.value)}
            style={styles.input}
            placeholder="Şifrenizi girin"
            disabled={loading}
            required
            minLength={6}
          />
        </div>
        <button type="submit" disabled={loading} style={loading ? styles.buttonDisabled : styles.button}>
          {loading ? 'Kayıt oluyor...' : 'Kayıt Ol'}
        </button>
      </form>
      {message && (
        <p style={{ 
          ...styles.message, 
          color: isError ? '#e74c3c' : '#2ecc71' 
        }}>
          {message}
        </p>
      )}
    </div>
  );
}

const styles = {
  container: {
    maxWidth: 400,
    margin: '50px auto',
    padding: 20,
    borderRadius: 12,
    boxShadow: '0 5px 15px rgba(0,0,0,0.2)',
    backgroundColor: '#fff',
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
  },
  title: {
    textAlign: 'center',
    marginBottom: 30,
    color: '#333',
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
  },
  inputGroup: {
    marginBottom: 20,
  },
  label: {
    marginBottom: 6,
    display: 'block',
    fontWeight: '600',
    color: '#555',
  },
  input: {
    width: '100%',
    padding: '12px 15px',
    fontSize: '1rem',
    borderRadius: 8,
    border: '1.5px solid #ccc',
    outline: 'none',
    transition: 'border-color 0.3s ease',
  },
  button: {
    padding: '14px',
    fontSize: '1.1rem',
    backgroundColor: '#5a67d8',
    color: 'white',
    fontWeight: '700',
    border: 'none',
    borderRadius: 12,
    cursor: 'pointer',
    transition: 'background-color 0.3s ease',
  },
  buttonDisabled: {
    padding: '14px',
    fontSize: '1.1rem',
    backgroundColor: '#a3aed0',
    color: 'white',
    fontWeight: '700',
    border: 'none',
    borderRadius: 12,
    cursor: 'not-allowed',
  },
  message: {
    marginTop: 20,
    fontWeight: '600',
    textAlign: 'center',
    fontSize: '1rem',
  },
};
